    "2015-02-04T19:38:36.245929",nt"name": "311-service-requests-graffiti-removal-5072e",nt"isopen":
    false,nt"url": null,nt"notes": "All open graffiti removal requests made
    to 311 and all requests completed since January 1, 2011. The Department of Streets
    & Sanitation's Graffiti Blasters crews offer a vandalism removal service to private
    property owners. Graffiti Blasters employ "blast" trucks that use baking soda
    under high water pressure to erase painted graffiti from brick, stone and other
    mineral surfaces. They also use paint trucks to cover graffiti on the remaining
    surfaces. Organizations and residents may report graffiti and request its removal.rn311
    sometimes receives duplicate requests for graffiti removal. Requests that have been
    labeled as Duplicates are in the same geographic area and have been entered into
    311u2019s Customer Service Requests (CSR) system at around the same time as a previous
    request. Duplicate reports/requests are labeled as such in the Status field, as
    either "Open - Dup" or "Completed - Dup." Data is updated daily.",nt"license_title":
